	<script>
		function systemSort(array){
			var copy = array;
			copy.sort(function(a,b){
				return a-b;
			});
			return copy;
		}
		function bubbleSort(array){
			var copy = array;
			var i=0,
				len=copy.length,
				j,
				temp;
			for(;i<len-1;i++){
				for(j=i+1;j<len;j++){
					if(copy[i]>copy[j]){
						temp=copy[i];
						copy[i]=copy[j];
						copy[j]=temp;
					}
				}
			}
			return copy;
		}
		function quickSort(array){
			if(array.length <= 1){
				return array;
			}

			var midKey = Math.floor(array.length / 2);
			var midValue = array.splice(midKey, 1)[0];

			var left = [];
			var right = [];

			for(var i=0; i<array.length; i++){
				if(array[i] < midValue){
					left.push(array[i]);
				}else{
					right.push(array[i]);
				}
			}

			return quickSort(left).concat([midValue], quickSort(right));
		}

		function log(func){
            return function(...args){
                const start = Date.now();
                let result = func(...args);
                const used = Date.now() - start;
                console.log(`call ${func.name} used ${used} ms.`);
                return result;
            };
        }
